import React from "react";
import '../css/profile.css';


function Profile(props) {
    return  (props.trigger) ? (
        <div className="popup">
            <div className="popup-inner">

                <button className="close-opup-btn">Close</button>
                {props.children}
            </div>
        </div>
    ) : "";
}


export default Profile;
